import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';
import ButtonAppBar from './bar.js';
import MyForm, {SecondComponent, UltimoComponente} from './login.js';


function App() {
  var w = window.innerWidth;
  return (
    <div className="App">
      <ButtonAppBar/>
      <MyForm />
      <SecondComponent></SecondComponent>
      <UltimoComponente></UltimoComponente>
    </div>
  );
}

export default App;
